(ns lambda-ml.examples.worksheets.decision-tree
  (:require [clojure.data.csv :as csv]
            [lambda-ml.decision-tree :refer :all]
            [lambda-ml.data.binary-tree :as bt]
            [lambda-ml.metrics :refer :all]
            [gorilla-plot.core :as plot]
            [gorilla-repl.image :as image]
            [rhizome.viz :as viz]
            :reload))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(def data
  (->> (slurp "http://archive.ics.uci.edu/ml/machine-learning-databases/iris/iris.data")
       (csv/read-csv)
       (remove #(< (count %) 5))
       (map #(map read-string %))))

(def header ["sepal length" "sepal width" "petal length" "petal width" "class"])
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;lambda-ml.examples.worksheets.decision-tree/header</span>","value":"#'lambda-ml.examples.worksheets.decision-tree/header"}
;; <=

;; @@
(def model (make-classification-tree gini-impurity 2 1 (count (first data))))
(def fit (decision-tree-fit model data))

(print-decision-tree fit)

(let [m (bt/adjacency-matrix (:parameters fit))
      label (fn [val] (if (meta val)
                        (str (nth header (:feature (meta val)))
                             " <= "
                             (:decision (meta val)))
                        val))]
  (-> (viz/graph->image (keys m)
                        #(get-in m [% :edges])
                        :node->descriptor (fn [n] {:label (label (get-in m [n :value]))}))
      (image/image-view)))
